import React from 'react'
import { Button, TextField } from '@material-ui/core'
import { ContainerPrincial, ContainerInput } from './styled'

const SignupPage = () => {

    return (

        <ContainerPrincial>
            <h1> Cadastre-se </h1>

            <ContainerInput>
            <TextField 
                name={"name"}
                label={"Nome"}
                variant={"filled"}
                fullWidth
                margin={'dense'}
                required
                type={"text"}
                focused
            /> 

            <TextField
                name={"name"}
                label={"Email"}
                variant={"filled"}
                fullWidth
                margin={'dense'}
                required
                type={"text"}
                focused
            /> 

            <TextField
                name={"name"}
                label={"Senha"}
                variant={"filled"}
                fullWidth
                margin={"dense"}
                required
                type={"text"}
                focused
            /> 
            </ContainerInput>

            <Button>Cadastra-se</Button>
        </ContainerPrincial>
    )
}

export default SignupPage
